import{cartInfo}from"../../data/cart"
const Cart=()=>{
    return(
<div className="cart">
    <div className="cart-title">Your Cart Shop</div>
    <div className="cart-wrapper">
        <div className="cart-items">
                {cartInfo.map(item=>
                    <div key={item.id} className="cart-item">
                        <img src={`/book/${item.image}` } alt={item.title} className="cart-item-img"/>

                        <div className="cart-item-info"></div>
                    </div> )}
        </div>
    </div>
    <div className="cart-order-summary"></div>
</div>

        )
}
export default Cart;
